 import React from 'react';
 import { StyleSheet, Text, View } from 'react-native';

 export default class App extends React.Component {

 state = {
   myState: 'Lorem ipsum dolor sit amet, consectetur adipisicing elit, used do eiusmodtempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quisnostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eufugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt inculpa qui officia deserunt mollit anim id est laborum.'
 }

  render() {
   return (
     <View style={styles.container}>
       <Text>Open up App.js to start working on your app!</Text>
       <Text> {this.state.myState} </Text>
       <StatusBar style="auto" />
     </View>
   );
 }

 styles = StyleSheet.create({
   container: {
     flex: 1,
     backgroundColor: '#fff',
     alignItems: 'center',
     justifyContent: 'center',
   },

 })
}
